import {useState} from 'react';
import { Modal,Button } from 'react-bootstrap';

function UpdateModelComponent(props) {
    const [isShow, invokeModal] = useState(false);

    const initModal = () =>{
        return invokeModal(!isShow);
    }
    return (
    <>
      <Button variant='success' onClick={initModal} >Edit</Button> 

      <Modal show={isShow} >
        <Modal.Header closeButton onClick={initModal} >
            <Modal.Title>Update Post</Modal.Title>
        </Modal.Header>
        
            <Modal.Body>
                this is my react bootstrap modal! ok
            </Modal.Body>

        <Modal.Footer>
            <Button variant='danger' onClick={initModal} >Close</Button>
            <Button variant='dark' onClick={initModal} >Update</Button>
        </Modal.Footer>

      </Modal> 
    </>
  )
}

export default UpdateModelComponent
